  \"2016-10-07T22:14:33.321838\",\n\t\"name\": \"nist-finger-minutiae-from-latent-and-matching-tenprint-images-for-1000-ppi-imagery-nist-sp\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Institute of Standards and
  Technology in conjunction with the Federal Bureau of Investigation has maintained
  a database of grayscale fingerprint images, corresponding minutiae and selected
  latent fingerprints corresponding to fingerprint images in the data set. This data
  set is known as Special Database 27 (SD-27) and provides 500 ppi imagery. In 2010,
  this data set was expanded to provide 1000 ppi imagery to the research community
  and has been made available for electronic distribution. This data set is herein
  referred to as SD-27A. This database is temporarily unavailable.\",\n\t\"license_title\":
